export default class BluetoothRemoteGATTServer {
    constructor(device: any);
    connectionId: any;
    device: any;
    connected: boolean;
    /**
     * connect to GATT server
     */
    connect(): Promise<BluetoothRemoteGATTServer>;
    /**
     * disconnect from a connection
     * we can pass connectionToken to disconnect all connections
     * but also pass only one connectionID
     */
    disconnect(): void;
    getPrimaryService(uuid: any): Promise<any>;
}
